INSERT INTO `analysis_templates_cpl` VALUES (7,'default','Template 1','Semua CPL tercapai dengan baik. Dari total {total_cpl} CPL yang diukur, seluruhnya ({jumlah_tercapai} CPL) telah mencapai standar minimal {standar_minimal}%. Mahasiswa menunjukkan kompetensi yang memadai sesuai dengan profil lulusan yang diharapkan.','Dari {total_cpl} CPL yang diukur, terdapat {jumlah_tidak_tercapai} CPL yang belum mencapai standar minimal {standar_minimal}%, yaitu: {cpl_tidak_tercapai_list}. Sementara itu, {jumlah_tercapai} CPL lainnya ({cpl_tercapai_list}) telah tercapai dengan baik. Diperlukan evaluasi lebih lanjut terhadap mata kuliah kontributor dan metode pembelajaran untuk meningkatkan capaian CPL yang belum tercapai.',1,'2026-02-04 03:41:24','2026-02-04 04:08:25'),(8,'formal','Template 2','Berdasarkan hasil evaluasi capaian pembelajaran lulusan untuk periode ini, dapat dilaporkan bahwa seluruh CPL (total {total_cpl} CPL) telah mencapai standar minimal yang ditetapkan yaitu {standar_minimal}%. Pencapaian ini menunjukkan bahwa proses pembelajaran telah berjalan efektif dan mahasiswa telah menguasai kompetensi yang diharapkan sesuai dengan standar KKNI.','Berdasarkan hasil evaluasi capaian pembelajaran lulusan, dari {total_cpl} CPL yang diukur, sebanyak {jumlah_tercapai} CPL ({persentase_tercapai}%) telah mencapai standar minimal {standar_minimal}%, yaitu: {cpl_tercapai_list}. Namun demikian, masih terdapat {jumlah_tidak_tercapai} CPL yang belum mencapai standar, yaitu: {cpl_tidak_tercapai_list}. Untuk CPL yang belum tercapai, diperlukan tindakan perbaikan berkelanjutan (Continuous Quality Improvement) yang mencakup evaluasi mata kuliah kontributor, perbaikan metode pembelajaran, serta penyesuaian strategi asesmen.',1,'2026-02-04 03:41:24','2026-02-04 04:08:25'),(9,'singkat','Template 3','Seluruh CPL tercapai (100%).','{jumlah_tercapai} dari {total_cpl} CPL tercapai ({persentase_tercapai}%). CPL yang belum tercapai: {cpl_tidak_tercapai_list}.',1,'2026-02-04 03:41:24','2026-02-04 04:08:25'),(10,'template_4','Template 4','Analisis capaian pembelajaran menunjukkan bahwa semua CPL telah tercapai dengan persentase keberhasilan 100%. Hasil ini mencerminkan efektivitas strategi pembelajaran yang diterapkan.','Hasil analisis menunjukkan bahwa dari {total_cpl} CPL, sebanyak {jumlah_tercapai} CPL telah tercapai ({persentase_tercapai}%), namun {jumlah_tidak_tercapai} CPL masih perlu perbaikan: {cpl_tidak_tercapai_list}. Rekomendasi tindak lanjut perlu segera dilakukan.',1,'2026-02-04 03:41:24','2026-02-04 04:08:25'),(11,'template_5','Template 5','Evaluasi terhadap {total_cpl} CPL menunjukkan pencapaian yang sangat baik dengan seluruh indikator terpenuhi. Mahasiswa telah mendemonstrasikan kompetensi sesuai dengan standar yang ditetapkan sebesar {standar_minimal}%.','Pencapaian CPL periode ini menunjukkan {persentase_tercapai}% CPL telah memenuhi standar ({cpl_tercapai_list}). Adapun CPL yang masih di bawah standar minimal {standar_minimal}% adalah: {cpl_tidak_tercapai_list}. Diperlukan intervensi pada mata kuliah pendukung CPL tersebut.',1,'2026-02-04 03:41:24','2026-02-04 04:08:25'),(12,'template_6','Template 6','Capaian pembelajaran lulusan untuk periode ini sangat memuaskan dengan tingkat pencapaian 100% untuk semua CPL.','CPL tercapai: {cpl_tercapai_list} ({persentase_tercapai}%). CPL perlu perbaikan: {cpl_tidak_tercapai_list}. Evaluasi dan perbaikan pembelajaran diperlukan untuk CPL yang belum tercapai.',1,'2026-02-04 03:41:24','2026-02-04 04:08:25');
