INSERT INTO `cpl` VALUES (10,'CPL01','Menginternalisasi (A5) nilai-nilai Pancasila dan disiplin dalam kehidupan masyarakat yang beragam.','S','2026-01-31 11:59:55'),(11,'CPL02','Menunjukkan sikap profesional, melalui kepatuhan (A2) dan responsif (A2) terhadap etika profesi dan perkembangan teknologi, serta pemahaman (C2) tentang pembelajaran sepanjang hayat.','S','2026-01-31 12:00:09'),(12,'CPL03','Memiliki kemampuan untuk menerapkan (C3) teori matematika untuk menyelesaikan berbagai permasalahan dengan prinsip-prinsip computing.','P','2026-01-31 12:00:52'),(13,'CPL04','Mampu menerapkan (C3) berbagai algoritma dan metode pemrograman serta pengolahan informasi visual untuk memecahkan masalah pada suatu organisasi.','KK','2026-01-31 12:01:07'),(14,'CPL05','Memiliki kemampuan bekerjasama yang baik dalam tim multi displin (A3) serta berkomunikasi (A2) secara efektif, baik secara lisan maupun tulisan.','KU','2026-01-31 12:01:19'),(15,'CPL06','Mampu mengambil keputusan (C5) secara tepat dalam konteks penyelesaian masalah di bidang keahliannya, berdasarkan hasil analisis data','P','2026-01-31 12:01:34'),(16,'CPL07','Memiliki kemampuan untuk menganalisis (C4), merancang (C6), menerapkan (C3), menguji (C5) dan memelihara (C3) perangkat lunak dengan berbagai kompleksitas.','KK','2026-01-31 12:01:52'),(17,'CPL08','Mampu mengimplementasikan (C3) algoritma dasar, algoritma kompleks, mengolah (C3) dan menganalisis (C4) data serta mampu mengintegrasikan (A4) berbagai teknik sistem cerdas untuk membangun solusi sistem cerdas komprehensif yang menyelesaikan masalah industri.','KK','2026-01-31 12:02:03'),(18,'CPL09','Memiliki kemampuan memahami (C2), merancang (C6), mengimplementasikan (C3), mengevaluasi (C5) dan memelihara (C3) sistem komputer, arsitektur komputer, serta jaringan komputer sesuai dengan kebutuhan organisasi.','KK','2026-01-31 12:02:17');
