INSERT INTO `cpmk` VALUES (11,'CPMK011','Mampu menginternalisasi nilai-nilai Pancasila dalam pengambilan keputusan dan penyelesaian masalah sosial','2026-01-31 05:39:30','2026-01-31 05:39:30'),(12,'CPMK012','Mampu menerapkan kedisiplinan dalam kehidupan masyarakat yang beragam','2026-01-31 05:39:40','2026-01-31 05:39:40'),(13,'CPMK021','Mampu menunjukkan kepatuhan dan sikap bertanggung jawab terhadap kode etik profesi di bidang informatika','2026-01-31 05:39:48','2026-01-31 05:39:48'),(14,'CPMK022','Mampu menunjukkan sikap responsif dan adaptif terhadap perkembangan teknologi terkini (responsif teknologi)','2026-01-31 05:39:59','2026-01-31 05:39:59'),(15,'CPMK023','Mampu memahami pentingnya pembelajaran sepanjang hayat dalam mendukung pengembangan kompetensi profesional di bidang informatika','2026-01-31 05:40:07','2026-01-31 05:40:07'),(16,'CPMK031','Mampu menerapkan teori matematika yang dapat mengaplikasikan teori himpunan, fungsi, dan logika dalam pemodelan relasional dan sistem formal','2026-01-31 05:40:18','2026-01-31 05:40:18'),(17,'CPMK032','Mampu menerapkan teori matematika yang dapat memanfaatkan aljabar linier dan kalkulus dalam pemrosesan data, transformasi numerik, dan simulasi komputasi','2026-01-31 05:40:25','2026-01-31 05:40:25'),(18,'CPMK033','Mampu menerapkan teori matematika yang dapat menerapkan metode statistik dan probabilistik untuk pengambilan keputusan berbasis data','2026-01-31 05:40:35','2026-01-31 05:40:35'),(19,'CPMK034','Mampu menerapkan teori matematika yang dapat menyelesaikan masalah komputasi dengan pendekatan numerik dan algoritmik','2026-01-31 05:40:43','2026-01-31 05:40:43'),(20,'CPMK035','Mampu menerapkan teori matematika yang dapat merancang dan mengevaluasi solusi dengan prinsip-prinsip computing dalam konteks tugas akhir atau penelitian','2026-01-31 05:40:52','2026-01-31 05:40:52'),(21,'CPMK041','Mampu menerapkan algoritma dan metode pemrograman untuk membangun solusi perangkat lunak yang efisien terhadap permasalahan fungsional organisasi','2026-01-31 05:41:01','2026-01-31 05:41:01'),(22,'CPMK042','Mampu menerapkan algoritma dan metode visualisasi dan pengolahan data multimedia untuk mendukung penyajian informasi dan pemrosesan data visual dalam sistem organisasi','2026-01-31 05:41:10','2026-01-31 05:41:10'),(23,'CPMK051','Mampu bekerja sama secara produktif dalam tim dengan anggota dari latar belakang disiplin ilmu yang berbeda untuk mencapai tujuan bersama','2026-01-31 05:41:18','2026-01-31 05:41:18'),(24,'CPMK052','Mampu menyampaikan gagasan, argumen, dan hasil kerja secara lisan dengan bahasa yang jelas, logis, dan mudah dipahami oleh khalayak umum atau profesional (berkomunikasi efektif secara lisan)','2026-01-31 05:41:28','2026-01-31 05:41:28'),(25,'CPMK053','Mampu menulis laporan teknis, dokumentasi, atau karya ilmiah yang terstruktur dan sesuai kaidah kebahasaan dan akademik (berkomunikasi efektif secara tertulis)','2026-01-31 05:41:36','2026-01-31 05:41:36'),(26,'CPMK061','Mampu mengevaluasi kualitas dan relevansi data untuk menilai efektivitas informasi yang diekstraksi dalam mendukung proses pengambilan keputusan','2026-01-31 05:41:45','2026-01-31 05:41:45'),(27,'CPMK062','Mampu menerapkan metodologi penelitian untuk pengumpulan dan analisis data secara sistematis.','2026-01-31 05:41:52','2026-01-31 05:41:52'),(28,'CPMK063','Mampu mengambil keputusan strategis dalam pengelolaan proyek berdasarkan analisis data','2026-01-31 05:42:00','2026-01-31 05:42:00'),(29,'CPMK064','Mampu memecahkan masalah kompleks dengan pendekatan berbasis data','2026-01-31 05:42:07','2026-01-31 05:42:07'),(30,'CPMK071','Mampu melakukan analisis kebutuhan dan spesifikasi perangkat lunak berdasarkan permasalahan dan kebutuhan pengguna.','2026-01-31 05:42:16','2026-01-31 05:42:16'),(31,'CPMK072','Mampu melakukan perancangan arsitektur dan desain perangkat lunak yang efektif dan efisien sesuai dengan kompleksitas sistem.','2026-01-31 05:42:28','2026-01-31 05:42:28'),(32,'CPMK073','Mampu melakukan penerapan dan implementasi perangkat lunak menggunakan teknologi dan metodologi yang tepat.','2026-01-31 05:42:35','2026-01-31 05:42:35'),(33,'CPMK074','Mampu melakukan pengujian perangkat lunak secara sistematis untuk memastikan kualitas dan fungsionalitas sistem.','2026-01-31 05:42:43','2026-01-31 05:42:43'),(34,'CPMK075','Mampu melakukan pemeliharaan perangkat lunak untuk menjaga kinerja dan relevansinya seiring waktu.','2026-01-31 05:42:51','2026-01-31 05:42:51'),(35,'CPMK081','Mampu menerapkan algoritma dasar dan teknik pemrograman untuk membangun fondasi sistem cerdas.','2026-01-31 05:43:02','2026-01-31 05:43:02'),(36,'CPMK082','Mampu mengolah dan menganalisis data untuk mendukung pengembangan solusi sistem cerdas.','2026-01-31 05:43:09','2026-01-31 05:43:09'),(37,'CPMK083','Mampu mengimplementasikan algoritma kompleks sebagai bagian dari sistem cerdas untuk menyelesaikan permasalahan industri.','2026-01-31 05:43:16','2026-01-31 05:43:16'),(38,'CPMK084','Mampu mengintegrasikan berbagai teknik AI untuk membangun solusi sistem cerdas komprehensif yang menyelesaikan masalah industri.','2026-01-31 05:43:23','2026-01-31 05:43:23'),(39,'CPMK091','Mahasiswa mampu memahami sistem komputer, arsitektur komputer, serta jaringan komputer sebagai dasar dalam merancang dan mengembangkan sistem komputasi yang efisien dan terintegrasi','2026-01-31 05:43:33','2026-01-31 05:43:33'),(40,'CPMK092','Mampu merancang kebutuhan sistem komputer, arsitektur komputer, serta jaringan komputer sesuai dengan kebutuhan organisasi.','2026-01-31 05:43:43','2026-01-31 05:43:43'),(41,'CPMK093','Mampu mengimplementasikan sistem komputer, arsitektur komputer, serta jaringan komputer yang sesuai dengan spesifikasi dan kebutuhan organisasi.','2026-01-31 05:43:50','2026-01-31 05:43:50'),(42,'CPMK094','Mampu mengevaluasi efektivitas dan efisiensi sistem komputer, arsitektur komputer, serta jaringan komputer dalam memenuhi kebutuhan organisasi menggunakan metrik yang tepat.','2026-01-31 05:43:59','2026-01-31 05:43:59'),(43,'CPMK095','Mampu memelihara sistem komputer, arsitektur komputer, serta jaringan komputer dan memberikan rekomendasi peningkatan berdasarkan hasil evaluasi kinerja.','2026-01-31 05:44:07','2026-01-31 05:44:07');
